      this.myEchart.setOption(option);
      this.myEchart.on("click", "series.scatter", (params) => {
        //    点击poi点显示侧边栏组件 ---- 触发自定义事件
        cxt.emit("showRight", true);
      });
    },
    // 地图
    showMap(id) {
      let chongqingChart = echarts.init(document.getElementById(id));
      chongqingChart.clear();
      echarts.registerMap("chongqing", chongqing);
