        console.log(_zoom,"suo")

        _option.series[0].data = JSON.parse(sessionStorage.getItem("mapList1"));
        _option.series[1].data = JSON.parse(sessionStorage.getItem("mapList2"));

        // _option.geo.center = [107.789305, 30.127088]

        if (_zoom >= 1.5) {
          console.log("dayu",_option.series[0].data)
          _option.series[0].data = _option.series[0].data
            ? this.mapData(_option.series[0].data, 0.1)
            : "";
          _option.series[1].data = _option.series[1].data
            ? this.mapData(_option.series[1].data, 0.1)
            : "";
        } else if (_zoom < 1.5) {
          _option.series[0].data = _option.series[0].data
            ? this.mapData(_option.series[0].data, 0.01)
            : "";
          _option.series[1].data = _option.series[1].data
            ? this.mapData(_option.series[1].data, 0.01)
            : "";
        }

        //清空
        chongqingChart.clear();
        chongqingChart.setOption(_option); //更新修改后的option配制
      });
      window.addEventListener("resize", function () {
